import logo from './logo.svg';
import './App.css';
import ListTask from './ListTask.js';
import Todo from './Header';
import RenderItems from './RenderItems.js';
import TodoList from './TodoList';

function App() {
  const { data } = this.props;
  return (
    <div>
      <RenderItems data={data} />
      <TodoList/>
    </div>
  );
}

export default App;
